import React from "react";
import Carousel from 'react-bootstrap/Carousel';
import ItemHolder from '../ItemCard/ItemHolder'
export function Carrousel(trioArray){
    return (
        <div style={{ display: 'block', padding: 30 }}>
        <h4>React-Bootstrap Carousel Component</h4>
        <Carousel>
            {trioArray.map((trio,index)=>{
                trio.map((products,index)=>{
                    <ItemHolder
                    product= {products}
                    ></ItemHolder>
                })
            })}
          <Carousel.Item interval={1500}>
          <ItemCard
            title={"askdfjalsdjflaksdf"}
            price={"sakdlnsf"}
            handleClick={console.log}
            imageUrl={"askdfjalsdjflaksdf"}
            description={"skdfalksdfjalksdf"}
            ></ItemCard>
          </Carousel.Item>

        </Carousel>
      </div>
    )
}
